import React from "react";

const comidas=[
    {
        "id":1,
        "nombre":"Milanesa",
        "precio":"TUCULO"
    },
    {
        "id":2,
        "nombre":"Empanada",
        "precio":"TUCULO"
    },
    {
        "id":3,
        "nombre":"Tortilla",
        "precio":"TUCULO"
    }


]

function Comida(){
    
        
        
    
    return (
        <>
        <ul>

            <li>
               <h2>{comidas[1].nombre}</h2>
               <h1>{comidas[1].precio}</h1>

            </li>
        </ul>
        
        </>
    )
}

export default Comida;
